import React from 'react';
import { Grid, Typography } from '@material-ui/core';

const HomeFeature = () => {
    return (
        <div style={{ backgroundColor: '#fff' }}>
            <div className="mycontainer">
                
                <Grid container sm={12}></Grid>

                <Grid container sm={12}></Grid>

            </div>
        </div>
    )
}

export default HomeFeature;
